tables.table_schema:
CREATE TABLE competitor_data (
    competitor_id INT PRIMARY KEY,
    competitor_name VARCHAR(50),
    keyword_analysis JSONB,
    backlink_analysis JSONB
);

CREATE TABLE competitors (
    competitor_id SERIAL PRIMARY KEY,
    competitor_name VARCHAR(255) NOT NULL,
    competitor_website VARCHAR(255) NOT NULL
);

CREATE TABLE keywords (
    keyword_id SERIAL PRIMARY KEY,
    keyword_name VARCHAR(255) NOT NULL,
    search_volume INTEGER,
    competition_level INTEGER
);

CREATE TABLE seo_metrics (
    competitor_id INTEGER REFERENCES competitors(competitor_id),
    backlinks INTEGER,
    domain_authority INTEGER,
    page_authority INTEGER
);

CREATE TABLE competitors (
    id INT PRIMARY KEY,
    competitor_name STRING,
    seo_strategy STRING
);

CREATE TABLE keywords (
    id INT PRIMARY KEY,
    keyword_name STRING,
    search_volume INT
);

CREATE TABLE website_traffic (
    id INT PRIMARY KEY,
    competitor_id INT,
    traffic_source STRING,
    traffic_count INT
);

CREATE TABLE ranking_history (
    id INT PRIMARY KEY,
    competitor_id INT,
    rank_date DATE,
    ranking_position INT
);
